import React from 'react';
import Users from './user/pages/Users';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom';

const App=()=> {
  return <Router>

    <Link to="/users">Users</Link>
    <Route path="/users"><Users/></Route>
  </Router>;
};

export default App;
